import React from 'react'
import Cookies from 'js-cookie';

const AvailableSlots = async (props) => {
    const dateSearch=props.date;
    const D_id =Cookies.get('userLoginData');
    if(dateSearch){

        const res = await fetch("http://localhost:3001/getSlots", {
            method: "POST",
            headers: {
                "Content-Type": "application/json"
            },
            body: JSON.stringify({
                D_id, dateSearch
            })
        });

    }
  return (
    <div>
      My AvailableSlots
      {props.date}
    </div>
  )
}

export default AvailableSlots
